import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
          <header className="App-header">
              <h1>Girls in Tech 2023</h1>
        <img src={logo} className="App-logo" alt="logo" />
        
        <div style={{width: '100%', transform: 'rotate(180deg)', transformOrigin: '0 0', color: 'black', fontSize: 44, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>Empowering individuals to grow their own vegetable garden</div>
          Edit <code>src/App.js</code> and save to reload.
      
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
